def gcd(x, y):
    if x<y:
        x, y = y, x
    if y==0:
        return x
    while y>0:
        return gcd(y, x%y)

def main():
    d = gcd(123456, 234567)
    print("gcd(11111111, 22222222)=", d)
    d = gcd(11111111, 22222222)
    print("gcd(11111111, 22222222)=", d)
    d = gcd(11111111, 22222222)
    print("gcd(11111111, 22222222)=", d)
    
